import inspect
import tkinter.messagebox as tkm
from tkinter import *
from tkinter.filedialog import askopenfilename
from PIL import ImageTk, Image
from backend import *
import math
import random
import base64

from tkText import CustomText

PTOLEMAI = b''
STAR = b''
EARTH = b''


class SolarSystem():

    def __init__(self):
        self.root = Tk()
        self.root.title("Geocentric Visualization")
        self.width = self.root.winfo_screenwidth()
        self.height = self.root.winfo_screenheight()
        self.heightCenter = (self.height / 2) * 0.9
        self.widthCenter = (self.width / 2)
        self.root.geometry('%sx%s' % (self.width, self.height))

        filename = 'Ptolemai.png'
        with open(filename, 'wb') as f:
            f.write(base64.b64decode(PTOLEMAI))
        img = Image.open('Ptolemai.png')
        img = ImageTk.PhotoImage(img)

        panel = Label(self.root, image=img)
        panel.place(x=0, y=-100, relwidth=1, relheight=1)

        b = Button(text="Выберите исходный модуль", command=self.fileChoice, bd=5, bg='#f6fd86')
        b.place(relx=.3, rely=.83, anchor="c")
        info = Button(text="О программе", command=self.clickAbout, bd=5, bg='#00fd86')
        info.place(relx=.7, rely=.83, anchor="c")
        mainloop()

    def clickAbout(self):
       tkm.showinfo("About", 'Визуализация программы на языке Python 3.6 при помощи геоцентрической метафоры. \n'
                      'Для начала необходимо выбрать исходный модуль с расширением .py - "Землю",'
                             ' на экран будет выведено представление'
                      ' исходного файла и его зависимостей в виде солнечной системы. '
                    'При нажатии на "Землю" будет выведен код содержащийся в модуле, цветом, совпадающим с цветом '
                             'планеты в солнечной системе будут подсвечены импортированныые объекты.')

    def fileChoice(self):
        self.filepath = askopenfilename()
        self.filename = os.path.basename(self.filepath).split('.')[0]
        if self.filepath.endswith(".py"):
            self.imports, self.stdlibs, self.obj_loaded = getImports(self.filepath)
            self.sizeOfASystem = len(self.imports)
            if self.sizeOfASystem > 20:
                toplevel = Toplevel()
                toplevel.geometry(f"400x200+%d+%d" % (self.width / 3, self.height / 3))
                label1 = Label(toplevel, text="Слишком много импортов для визуализации", height=500, width=100)
                label1.place(relx=.5, rely=.53, anchor=CENTER)
            else:
                self.drawSystem()
        else:
            toplevel = Toplevel()
            toplevel.geometry(f"400x200+%d+%d" % (self.width / 3, self.height / 3))
            label1 = Label(toplevel, text="Выберете файл с расширением .py", height=500, width=100)
            label1.place(relx=.5, rely=.53, anchor=CENTER)

    def pressedPlanet(self, _, data):
        toplevel = Toplevel()
        toplevel.geometry(f"750x400+%d+%d" % (self.width / 3, self.height / 3))
        S = Scrollbar(toplevel)
        T = CustomText(toplevel, height=4, width=85)
        S.pack(side=RIGHT, fill=Y)
        T.pack(side=LEFT, fill=Y)
        S.config(command=T.yview)
        T.config(yscrollcommand=S.set)
        T.insert(END, data)
        self.decorateText(T)

    def decorateText(self, obj):
        for module, col in self.colorData:
            higlight = []
            higlight += [m[0] for m in inspect.getmembers(self.obj_loaded[module],
                                                          inspect.isclass) if m[1].__module__ == module]
            higlight += [m[0] for m in inspect.getmembers(self.obj_loaded[module],
                                                          inspect.isfunction) if m[1].__module__ == module]
            higlight.append(module + '.')
            r = int(col[1:3], 16)
            g = int(col[3:5], 16)
            b = int(col[5:7], 16)
            brightness = (r * 299 + g * 587 + b * 114) / 1000
            if brightness < 113:
                for el in higlight:
                    obj.highlight_pattern(pattern=el, tag=module, col=col, forgr='white')
            else:
                for el in higlight:
                    obj.highlight_pattern(pattern=el, tag=module, col=col)

    def get_metrics(self):
        sizes = {}
        coeff = {}
        for el in self.obj_loaded.keys():
            sizes[el] = os.path.getsize(self.obj_loaded[el].__file__)
        sorted_x = sorted(sizes.items(), reverse=True, key=lambda kv: kv[1])
        for el in sorted_x[len(sorted_x) // 3:]:
            coeff[el[0]] = 1
        for el in sorted_x[len(sorted_x) // 3:2 * len(sorted_x) // 3]:
            coeff[el[0]] = 2
        for el in sorted_x[:len(sorted_x) // 3]:
            coeff[el[0]] = 3
        return coeff

    def drawPlanets(self, n: int):
        metrics = self.get_metrics()
        self.colorData = []
        colour = lambda: '#{:06x}'.format(random.randint(0, 0xfffff0))
        out = self.filename + " module \n\n"
        with open(self.filepath) as ff:
            out += ff.read()
        self.canvas.tag_bind(self.earth, "<ButtonPress-1>",
                             lambda event, arg=out: self.pressedPlanet(event, arg))
        self.max = n + 1
        for self.a in range(1, n + 1):
            col = colour()
            self.a0 = self.a - 1
            self.colorData.append((self.imports[self.a0], col))
            if (0.5 * self.height * 3 * self.a / (4 * n) < 60):
                self.a = self.max
                self.max += 1
            self.canvas.create_text(
                self.widthCenter + 0.5 * 3 * self.a / (4 * n) * self.height * math.sin(math.pi / 3 * self.a),
                self.heightCenter - 0.5 * 3 * self.a / (4 * n) * self.height * math.cos(math.pi / 3 * self.a) - 23,
                text=self.imports[self.a0], font=('Times bold', '14'), fill='black')
            self.canvas.create_oval(
                (self.widthCenter - 0.5 * self.height * 3 * self.a / (4 * n)),
                (self.heightCenter - 0.5 * self.height * 3 * self.a / (4 * n)),
                (self.widthCenter + 0.5 * self.height * 3 * self.a / (4 * n)),
                (self.heightCenter + 0.5 * self.height * 3 * self.a / (4 * n)),
                dash=(1, 1), outline='darkgreen')
            obj = self.canvas.create_oval(
                (self.widthCenter + 0.5 * 3 * self.a / (4 * n) * self.height * math.sin(math.pi / 3 * self.a)
                 - metrics[self.imports[self.a0]] * 5),
                (self.heightCenter - 0.5 * 3 * self.a / (4 * n) * self.height * math.cos(math.pi / 3 * self.a)
                 - metrics[self.imports[self.a0]] * 5),
                (self.widthCenter + 0.5 * 3 * self.a / (4 * n) * self.height * math.sin(math.pi / 3 * self.a)
                 + metrics[self.imports[self.a0]] * 5),
                (self.heightCenter - 0.5 * 3 * self.a / (4 * n) * self.height * math.cos(math.pi / 3 * self.a)
                 + metrics[self.imports[self.a0]] * 5),
                fill=col)
            f = os.path.dirname(self.filepath) + "/" + self.imports[self.a0] + '.py'
            out = self.imports[self.a0] + " module \n\n"
            try:
                with open(f) as ff:
                    out += ff.read()
            except:
                out += "no preview available"

            self.canvas.tag_bind(obj, "<ButtonPress-1>", lambda event, arg=out: self.pressedPlanet(event, arg))

    def drawStars(self):
        filename = 'star.png'
        with open(filename, 'wb') as f:
            f.write(base64.b64decode(STAR))
        star = Image.open('star.png')
        star = star.resize((30, 30), Image.ANTIALIAS)
        star = ImageTk.PhotoImage(star)
        self.star = star
        st = len(self.stdlibs) // 2
        h = random.sample(range(4, 14), len(self.stdlibs) // 2 + 1)
        w = lambda: random.uniform(1.2, 1.6)
        for el in range(st):
            h1 = h[el] / 8
            w1 = w()
            self.canvas.create_image(self.widthCenter - self.heightCenter * w1, h1 * self.heightCenter, image=self.star,
                                     anchor=CENTER)
            self.canvas.create_text(
                self.widthCenter - self.heightCenter * w1, h1 * self.heightCenter + 23,
                text=self.stdlibs[el], font=('Times bold', '14'), fill='black')
        for el in range(st, len(self.stdlibs)):
            h1 = h[el - st] / 8
            w1 = w()
            self.canvas.create_image(self.widthCenter + self.heightCenter * w1, h1 * self.heightCenter, image=self.star,
                                     anchor=CENTER)
            self.canvas.create_text(
                self.widthCenter + self.heightCenter * w1, h1 * self.heightCenter + 23,
                text=self.stdlibs[el], font=('Times bold', '14'), fill='black')

    def drawSystem(self):
        self.root.title("Geocentric Visualization")

        self.canvas = Canvas()
        self.canvas.config(height=self.height, width=self.width)
        self.canvas.config(bg="white")

        filename = 'earth.png'
        with open(filename, 'wb') as f:
            f.write(base64.b64decode(EARTH))
        earth = Image.open('earth.png')
        earth = earth.resize((60, 60), Image.ANTIALIAS)
        earth = ImageTk.PhotoImage(earth)

        self.root.earth = earth
        self.earth = self.canvas.create_image(self.widthCenter, self.heightCenter, image=earth, anchor=CENTER)
        self.canvas.pack()
        self.canvas.create_text(
            self.widthCenter,
            self.heightCenter - 40,
            text=self.filename, font=('Times bold', '14'), fill='black')
        self.drawPlanets(self.sizeOfASystem)
        self.drawStars()


if __name__ == '__main__':
    s = SolarSystem()
